  JBURBURY, Helen Christine Eleanor and WILDING, Edwyn Peter
  01> BURBURY, Helen Christine m on 10.07.1990 to WILDING, Edwyn Peter
  Eleanor
  b 04.09.1952
  b 15.05.1930
  Helen b. at Hastings and m. at Christchurch, Peter, s/o Edwyn Arnold Fraser Wilding (of Te Manaia,
  Parnassus, North Canterbury) and Esther Victoria Armstrong (of Akitio, Dannevirke). Address: Lake
  Hayes, RD 1, Queenstown.
  Helen is a secretary and prior to marriage was Executive Assistant in Washington DC to Dr Omar
  Zawawi, KCMG, Special Advisor to the Sultan, Muscat, Oman.
  Peter farmed at Wilanda Downs, Ohai, Southland. He was a member of the Wallace County Council
  (1962-89), Chairman (1973-76 and 1986-89); member of the Southland United Council (1981-89),
  Chairman (1986-89); member of the Southland Regional Development Council (1973-89), Chairman
  (1973-82); an inaugural member of the New Zealand Planning Council (1977-80). He is a director of
  the Alliance Freezing Co (1973-91). Peter is a Justice of the Peace and has been awarded the OBE.
  02> BURBURY, Nigel Duncan m on 17.12.1977 to STAINER, Jacqueline
  b 22.05.1953
  b 12.03.1954
  Nigel b. and m. at Hastings. Jacqueline, d/o Patrick Stainer and Anita Missen, b, at Dunedin.
  Address: "Te Hapua", Moore Road, RD 2, Hastings.
  Nigel and Jacqueline are orchardists, producing peaches and pears for canning and apples for
  export. Together with their five children, they enjoy a large garden in the picturesque Tukituki
  Valley. Jacqueline works part-time as an activities coordinator with the elderly. They both enjoy
  tennis, running, gardening and small scale wine making.
